//@ts-nocheck
import { jsPDF } from 'jspdf';

let fontNormal =
    '';

let fontMedium =
    '';

let callAddFont = function () {
    this.addFileToVFS('Geometria-normal.ttf', fontNormal);
    this.addFileToVFS('Geometria-Medium.ttf', fontMedium);
    this.addFont('Geometria-normal.ttf', 'Geometria', 'normal');
    this.addFont('Geometria-Medium.ttf', 'Geometria', 'bold');
};

jsPDF.API.events.push(['addFonts', callAddFont]);

export { callAddFont, jsPDF };
